import styles from "./ProfileButton.module.scss";
import abhikAvatar from "../../assets/abhik.jpeg";
import { CaretDown, CaretDownIcon } from "@phosphor-icons/react";

export function ProfileButton() {
  return (
    <button className={styles.profileButton}>
      <img
        src={abhikAvatar}
        alt="Profile"
        className={styles.avatar}
        draggable={false}
      />
      <div className={styles.textContainer}>
        <div className={styles.name}>Abhik Pramanik</div>
      </div>
      <CaretDownIcon size={12} className={styles.downArrow} weight="bold" />
    </button>
  );
}
